import React from 'react'
import './Services.css'
import heartemoji from '../../img/heartemoji.png'
import glasses from '../../img/glasses.png'
import humble from '../../img/humble.png'
import Card from '../Card/Card'
const Services = () => {
  return (
    <div className='services'>
      <div className="s-left">
        <span>My Awesome </span>
        <span>services</span>
        <span>This is the simple and dummy text for testing. That's it!!</span>
        <button className="button s-button">Download CV</button>
      </div>
      <div className="s-right" style={{width: "18rem"}}>
      <div className='blur'style={{backgroud:"rgb(238 210 255)"}}></div>
      <div className="blur" style={{background: '#c1f5ff', top:'10rem', height:'20rem', width:'50rem', left: '10rem'}
            }></div>
        <div className='Card1' style={{top: "-5rem", right: "-22rem"}} >
          <Card
            emoji={heartemoji}
            heading={'Design'}
            detail={"Figma, Sketch, Photoshop, Adobe, Adobe XD"}

          />
        </div>
          <div className='Card2'style={{top: "6rem", right: "-3rem"}}>
              <Card
              emoji={glasses}
              heading={'Developer'}
              detail={'HTML, CSS, JavaScript, React'}
              />
          </div>
        <div className='Card3'style={{top: "13rem", right: "-19rem"}}>
          <Card 
          emoji= {humble}
          heading = {'UI/UX'}
          detail= {'this is for testing 1,2,3 '}
          />
        </div>
      </div>
    </div>
  )
}

export default Services
